window.onload=function(){$.each($(".level0"),function(a,b){showBox(b,".level1")})};function showBox(k,b){var e=$(k).children(b);var j=e[0].offsetWidth;var a=Math.floor($(k)[0].clientWidth/j);var g=[];var d=[];for(var c=0;c<e.length;c++){if(c<a){g.push(e[c].offsetHeight)}else{var l=Math.min.apply(null,g);var f=getMinIndex(g,l);e[c].style.position="absolute";e[c].style.top=l+"px";e[c].style.left=j*f+"px";g[f]+=e[c].offsetHeight}}for(var c=0;c<e.length;c++){d.push(e[c].offsetHeight+e[c].offsetTop)}$(k)[0].style.height=Math.max.apply(null,d)+"px"}function getMinIndex(a,c){for(var b=0;b<a.length;b++){if(a[b]==c){return b}}};